scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount"); 
fecha_proceso = scriptletContext.get("fecha_proceso");
UIM_MES_FACT = scriptletContext.get("UIM_MES_FACT");
UIM_ANIO_FACT = scriptletContext.get("UIM_ANIO_FACT");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UIM_FECHA_PROCESO = curr_year+"-"+curr_month+"-"+curr_date;

var insert="";
var insert2="";

if(queryCount > 0){
    insert+="BEGIN\n"; 
	linea = query_results.split("\n");
	for(i=0; i < linea.length; i++){
	    linea_insert = linea[i];
	    insert+='INSERT INTO TBL_RED_USO_INFRA_MENSUAL (UIM_FECHA_PROCESO,UIM_BAN_CODIGO_BANCO,UIM_CODIGO_BANCO,UIM_TOTAL_TNX,UIM_IMPORTE_TOTAL,UIM_SUBTOTAL,UIM_IVA,UIM_TOTAL,UIM_SERVICIO,UIM_DESCRIPCION,UIM_MES_FACT,UIM_ANIO_FACT) VALUES (to_date("'+UIM_FECHA_PROCESO+'","yyyy-mm-dd"),'+linea_insert+','+'"VTG"'+','+'"DETALLE VG BCO"'+','+UIM_MES_FACT+','+UIM_ANIO_FACT+');\n';
		insert2+=UIM_FECHA_PROCESO+','+linea_insert+','+'"VTG"'+','+'"DETALLE VG BCO"'+','+UIM_MES_FACT+','+UIM_ANIO_FACT+'\n';
		insert = insert.replace(/\"/g,"'");
		insert = insert.replace(/null/g,"''");
	} // fin for
	insert+="COMMIT;\n";
	insert+="END;";
} // fin if


// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 

scriptletContext.putGlobal("INSERT_SENTENCE", insert);
scriptletContext.putGlobal("INSERT_SENTENCE2", insert2);  

// ===========================================================================================

staticBinding.value:
WITH TEMPORAL AS ( SELECT A.UID_BAN_CODIGO_BANCO AS ADQUIRIENTE, A.UID_CODIGO_BANCO AS EMISOR, /*TOTAL TNX*/ SUM(CASE WHEN TRIM(A.UID_CODIGO_TIPO_MENSAJE)='0210' THEN A.UID_TOTAL_TNX WHEN TRIM(A.UID_CODIGO_TIPO_MENSAJE)='0420' THEN (-1)*A.UID_TOTAL_TNX ELSE 0 END) AS TOTAL_TNX, /*IMPORTE TOTAL*/ SUM(CASE WHEN TRIM(A.UID_CODIGO_TIPO_MENSAJE)='0210' THEN A.UID_IMPORTE_TOTAL WHEN TRIM(A.UID_CODIGO_TIPO_MENSAJE)='0420' THEN (-1)*A.UID_IMPORTE_TOTAL ELSE 0 END) AS IMP_TOTAL
FROM TBL_RED_USO_INFRA_DIARIO A WHERE TRIM(A.UID_BAN_CODIGO_BANCO) NOT IN ('0000','EGLO','MDS','VISA','JCB','UPAY','CIBC','B878','T878') AND TRIM(A.UID_CODIGO_BANCO) NOT IN ('0000','EGLO','MDS','VISA','JCB','UPAY','CIBC','B878','T878') AND TRIM(A.UID_SERVICIO) = 'VTG' AND TRIM(A.UID_DESCRIPCION) IN ('ORIGINALES','REVERSOS') AND A.UID_FECHA_PROCESO BETWEEN to_date('${primerDia}','yyyy-mm-dd') AND to_date('${ultimoDia}','yyyy-mm-dd') GROUP BY A.UID_BAN_CODIGO_BANCO,A.UID_CODIGO_BANCO ORDER BY A.UID_BAN_CODIGO_BANCO,A.UID_CODIGO_BANCO )
SELECT '"'||ADQUIRIENTE||'"', '"'||EMISOR||'"', TOTAL_TNX,IMP_TOTAL,
/*COMISION*/ ( CASE WHEN EMISOR NOT IN (SELECT CODIGO_BANCO FROM BANCOS WHERE CODIGO_BANCO_P = ADQUIRIENTE) AND ADQUIRIENTE <> EMISOR THEN IMP_TOTAL*(SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'VENTA GENERICA' AND B.UIT_ENTIDAD='GENERAL' AND B.UIT_OPERATIVA='NACIONAL' AND B.UIT_GRUPO='COMISION') ELSE 0 END ) AS COMISION,
/*IVA*/ ( CASE WHEN EMISOR NOT IN (SELECT CODIGO_BANCO FROM BANCOS WHERE CODIGO_BANCO_P = ADQUIRIENTE) AND ADQUIRIENTE <> EMISOR THEN IMP_TOTAL* (SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'VENTA GENERICA' AND B.UIT_ENTIDAD='GENERAL' AND B.UIT_OPERATIVA='NACIONAL' AND B.UIT_GRUPO='COMISION')* (SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'IVA') ELSE 0 END ) AS IVA,
/*TOTAL*/ ( CASE WHEN EMISOR NOT IN (SELECT CODIGO_BANCO FROM BANCOS WHERE CODIGO_BANCO_P = ADQUIRIENTE) AND ADQUIRIENTE <> EMISOR THEN (IMP_TOTAL* (SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'VENTA GENERICA' AND B.UIT_ENTIDAD='GENERAL' AND B.UIT_OPERATIVA='NACIONAL' AND B.UIT_GRUPO='COMISION')) + (IMP_TOTAL* (SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'VENTA GENERICA' AND B.UIT_ENTIDAD='GENERAL' AND B.UIT_OPERATIVA='NACIONAL' AND B.UIT_GRUPO='COMISION')* (SELECT B.UIT_IMPORTE_TARIFA_PSOS FROM TBL_RED_USO_INFRA_TARIFAS B WHERE B.UIT_OPERACION = 'IVA')) ELSE 0 END ) AS TOTAL
FROM TEMPORAL
